import logo from './logo.svg';
import './App.css';
import { Component } from 'react';
import firebase from './Redux/constants/appconfig';
import data from './data.json';
export default class App extends Component {
  constructor(props) {
    super(props);
    var arr = [];
    for (var i in Object.keys(data.users)) {
      for (var j in Object.values(data.users)) {
      }
      var key = Object.keys(data.users)[i]
        var values = Object.values(data.users)[j]
        arr.push({
          key: key,
          value: values
        })
    }
    for (var k in arr)
    {
      firebase.database().ref('tutorial/'+ arr[k].key).set({
        name:arr[k].value.name,
        account:arr[k].value.account,
      }).then(snapshot=>{
        console.log("snapshot",snapshot)
      });
    }
    console.log("arr",arr)
  }
  componentDidMount() {
    //var usersRef = firebase.ref("users");
    // firebase.database().ref('tutorial/').set({
    //   email: "prashil"
    // });
  }


  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
        </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
        </a>
        </header>
      </div>
    );
  }
}
